                match id {
                    355 => ul_carrier_list = Some(NrCarrierList::decode(data)?),
                    389 => dl_carrier_list = Some(NrCarrierList::decode(data)?),
                    _ => data.advance_maybe_err(ie_length, false)?,
                }
                data.decode_align()?;
